import React from "react";

const Results = (props) => {
  return (
    <div>
      <h3>Results</h3>
      Intuition: <h5>{Math.floor(props.intuitionPercentage)}</h5>
      sensing: <h5>{Math.floor(props.sensingPercentage)}</h5>
    </div>
  );
};

export default Results;
